met Cameron Diaz, Ashton Kutcher en Queen Latifah

Twee vreemdelingen ontmoeten elkaar in Las Vegas. Als de twee tijdens een feestje stomdronken worden besluiten ze in hun 
dronken bui te gaan trouwen. De volgende morgen komen ze er echter achter hoe dom ze geweest zijn, maar ze winnen ook de 
jackpot. Vechtend over wie de jackpot mag hebben groeien de twee dichter naar elkaar toe.
